import { useNavigate } from "react-router-dom";

function FixedDestination() {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: "center", padding: "40px" }}>
      <h2>Fixed Destination Mode</h2>

      <input placeholder="Destination" /><br /><br />
      <input placeholder="Days" /><br /><br />
      <input placeholder="Budget" /><br /><br />

      <select>
        <option>Solo</option>
        <option>Couple</option>
        <option>Family</option>
        <option>Friends</option>
      </select>

      <br /><br />

      <button onClick={() => navigate("/itinerary")}>
        Generate Itinerary
      </button>
    </div>
  );
}

export default FixedDestination;
